/* eslint-disable no-undef */
import '@babel/polyfill'
import { login, logout } from './login'
import { displayMap } from './mapbox'
import { updateUserData } from './updateSettings'
import { bookingTour } from './booking'

const loginForm = document.getElementById('loginForm')

if (loginForm)
  loginForm.addEventListener('submit', function (event) {
    event.preventDefault()

    const email = document.getElementById('email').value
    const password = document.getElementById('password').value

    login(email, password)
  })

const locations = document.getElementById('map')
if (locations) displayMap(JSON.parse(locations.dataset.locations))

const logoutBtn = document.getElementById('logoutBtn')
if (logoutBtn) logoutBtn.addEventListener('click', logout)

const updateMeForm = document.getElementById('updateMeForm')
if (updateMeForm)
  updateMeForm.addEventListener('submit', (event) => {
    event.preventDefault()
    const email = document.getElementById('email').value
    const name = document.getElementById('name').value
    const photo = document.getElementById('photo').files[0]
    const form = new FormData()

    form.append('email', email)
    form.append('name', name)
    form.append('photo', photo)

    updateUserData(form)
  })

const changePwdForm = document.getElementById('changePwdForm')
if (changePwdForm)
  changePwdForm.addEventListener('submit', (event) => {
    event.preventDefault()
    const currentPassword = document.getElementById('password-current').value
    const newPassword = document.getElementById('password').value
    const newPasswordConfirm = document.getElementById('password-confirm').value

    updateUserData(
      { currentPassword, newPassword, newPasswordConfirm },
      'password'
    )
  })

const bookingBtn = document.getElementById('bookTourBtn')

if (bookingBtn)
  bookingBtn.addEventListener('click', async (event) => {
    const { tourId } = event.target.dataset
    bookingBtn.innerText = 'Loading...'
    await bookingTour(tourId)
  })
